import Home from '~/page/Home'
import NewProduct from '~/page/NewProduct'
import Tragop from '~/page/Tragop'


const publicRoutes = [
    {path:'/', component: Home},
    {path:'/tragop', component: Tragop},
    {path:'/newsp', component: NewProduct}
]

const privateRoutes=[

]

export {publicRoutes, privateRoutes}
